import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import 'bootstrap/dist/css/bootstrap.css';

class Register_box extends React.Component {

    render() {
        return (
            <form>
                <p className="text-center font-weight-bold text-white">New SX message</p>
                <div className="form-row d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="fromDate p-2 flex-grow-1">
                        <p className="text-center text-white">From</p>
                        <input type="date" className="form-control" placeholder="From date"/>
                    </div>
                    <div className="toDate p-2 flex-grow-1">
                        <p className="text-center text-white">To</p>
                        <input type="date" className="form-control" placeholder="To date"/>
                    </div>
                </div>
                <div className="message">
                    <p className="text-center text-white">Message</p>
                    <input type="String" className="form-control" placeholder="Message"/>
                </div>
                <div className="type p-3 flex-grow-1">
                    <button type="button" className="btn btn-outline-light p-3">Light</button>
                    <button type="button" className="btn btn-outline-light p-3">Light</button>
                    <button type="button" className="btn btn-outline-light p-3">Light</button>
                </div>
            </form>

        );
    }
}

class New_SX extends React.Component {
    render() {
        return (
            <div className="new_sx">
                <div className="register_box" >
                    <Register_box />
                </div>
            </div>
        );
    }
}

// ========================================

ReactDOM.render(
    <New_SX />,
    document.getElementById('root')
);
